import React from 'react'

function Contact() {

  <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.5.1/css/all.min.css" integrity="sha512-Ft6lNG+MlNjgk9p5DAmZLs4DolB45zUnFsbFiivOZ/HtFZ9h6qevQkk5fnHFTRpy4DFeLU0IplswdNs+o/3VnQ==" crossorigin="anonymous" referrerpolicy="no-referrer" />
  return (
    <div><i class="fa-brands fa-instagram"></i></div>
  )
}

export default Contact;
